// frontend/src/components/Settings.js
import React from 'react';
import { Container, Typography, Paper, Switch, FormControlLabel, Button } from '@mui/material';

const Settings = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Settings
      </Typography>
      <Paper elevation={3} style={{ padding: '16px', marginBottom: '16px' }}>
        <Typography variant="h6">General Settings</Typography>
        <FormControlLabel control={<Switch />} label="Enable Dark Mode" />
        <FormControlLabel control={<Switch />} label="Enable Notifications" />
        <Button variant="contained" color="primary" style={{ marginTop: '16px' }}>Save Settings</Button>
      </Paper>
    </Container>
  );
};

export default Settings;
